import dropDown from "../images/Icon_dropDown.png";

function Home() {
  return (
    <div className="w-[390px] h-[135px]  text-[24px] text-[#000000] font-semibold ">
      <div className="border-b-[0.5px] border-purple absolute w-[250px] h-[28px] ml-[70px] mt-[45px] font-light flex  justify-center text-base">
        멋쟁이 사자처럼
        <button>
          <img
            src={dropDown}
            alt="drop"
            className="w-[25px] h-[25px] mt-[40px] mr-[300px]"
          ></img>
        </button>
      </div>
    </div>
  );
}

export default Home;

